    root: {
        width: '100%',
        height: '100%',
        display: 'flex',
    }
});

function Chat(args) {
    const classes = useStyles();
    const { login } = args;
    return (
        <div className={classes.root}>
            <SidePanel {...args}></SidePanel>
            <MainPanel currentRoom="Business"/>
        </div>
    );
}

export default Chat;
